// import {} from 'react-icons/ai'

export const PostItem = ({ posts }) => {

    if (!posts) {
        return <div>Записи відсутні</div>
    }
    return <div>
        <div className="post-item">
            <h3>{ posts.model }</h3>
            <p>{ posts.urlOff }</p>
            <p>{ posts.urlBook }</p>
            <p>URL img</p>
            <p>{ posts.info }</p>
        </div>
        </div>

}
